        yt:type=''partner''>mrviralnews</media:credit><media:description type=''plain''>9
        Year Old Girl Football Star - Sam Gordon Football Player Highlights - Nine
        Year Old Little Girl Football Player - Samantha Gordon Music by: Music Producer
        J Farell jfarellmusic.com Sam Gordon is the latest young football player to
        become an Internet sensation by scoring 35 touchdowns, rushing for nearly
        2000 yards and making moves like a young — very young — Walter Payton. Sam
        Gordon also happens to be Samantha Gordon, a 9-year-old girl playing in a
        mostly all-boys tackle football league in the Salt Lake City area. Her father,
        Brent, uploaded a video to YouTube that has been viewed nearly 2 million times.
        "When she was about 3 or 4 years old and we would play soccer out in the yard
        with my older son ... and they''d try to be a little bit rough with her and
        even intentionally try to kick the ball at her and she wouldn''t be fazed
        and would keep getting up," Gordon said on "Good Morning America." "I kind
        of had an idea that she''s got an aggressive mentality back then." Gordon,
        nicknamed "Sweet Feet," is a star on Ute Conference team she joined as a starting
        quarterback after acing nearly every speed and agility drill in tryouts. She
        also happens to have 65 tackles and her father admits that he was worried
        about how the video would be received, particularly the part that shows some
        fairly hard hits. "I wasn''t really sure what kind of response people would
        have," he said. "I thought it was impressive and it appears that other people
